import React from 'react';
import './App.css';
import Cell from "./Components/Cell/Cell"
import { Stage, Layer }  from 'react-konva';

let row1 = function row() {
  var result = ""
  for(let i = 0; i<10; i++)
  {
    result += `<Cell\n x={${50 + i*(35)}}\n y={50} \n/>\n`;
  }
  console.log(result)
  return result
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Stage width={window.innerWidth} height={window.innerHeight}>
      <Layer>
          <Cell
            x={50}
            y={50} 
          />
          <Cell
            x={85}
            y={50} 
          />
          <Cell
            x={120}
            y={50} 
          />
          <Cell
            x={155}
            y={50} 
          />
          <Cell
            x={190}
            y={50} 
          />
      </Layer>
      </Stage>
      </header>
    </div>
  );
}

export default App;
